import React from 'react';
import { useParams } from 'react-router-dom';

const Product_detail = ({ data, reLoad }) => {
	const { id } = useParams();
	const product = data.find(product => product.id === id);
	console.log(product);
	return (
		<div>
			<h1>{product.name}</h1>
			<p>{product.price}</p>
			<img src={product.image} />
			<p>{product.desc}</p>
		</div>
	)
}

export default Product_detail
